import React from "react";
import { Link } from "react-router-dom";

export default function Splash() {
  return (
    <div class="splash">
      <h1 class="page__title">I Live In Russia</h1>
      <p class="page__subtitle">
        Geography Quizzes for everybody who wants to learn more about Russia
      </p>
      <div>
      <Link to="/login" className="register__signin">
          Войти
        </Link>
        </div>
        <div>
        <Link to="/sign-up" className="register__signin">
          Зарегестрироваться
        </Link>
        </div>
    </div>
  );
}
